void zeroMatrix(int** arr, int nRows, int nCols) {
    // Fill the last row with values from bottom-most non-zero row.
    fill(arr, nRows, nCols);

    // Merge rows to get zeros at top of matrix.
    merge(arr, nRows, nCols);
