void fill(int** arr, int n) {
	for (int i = 0; i < n; ++i) {
		for (int j = 0; j < n; ++j) {
			if (!arr[i][j]) {
				arr[i][j] = -1;
			}
		}
	}
}

void print(int** arr, int n) {
	for (int i = 0; i < n; ++i) {
		for (int j = 0; j < n; ++j) {
			cout << arr[i][j] << " ";
		}
		cout << endl;
	}
}

bool check(int** arr, int x, int y, int val, int n) {
	// check row and column
	for (int i = 0; i < n; ++i) {
		if ((arr[x][i] == val && i!= y) || (arr[i][y] == val && i!= x)) {
			return false;
		}
	}

	// check sub-grid
	int sx = x / 3 * 3;
	int sy = y / 3 * 3;
	for (int i = sx; i < sx + 3; ++i) {
		for (int j = sy; j < sy + 3; ++j) {
			if (arr[i][j] == val &&!(i == x && j == y)) {
				return false;
			}
		}
	}

	return true;
}

bool solveSudoku(int** arr, int n) {
	fill(arr, n);

	for (int i = 0; i < n; ++i) {
		for (int j = 0; j < n; ++j) {
			if (arr[i][j] == 0) {
				for (int k = 1; k <= n; ++k) {
					if (check(arr, i, j, k, n)) {
						arr[i][j] = k;
						if (solveSudoku(arr, n)) {
							return true;
						} else {
							arr[i][j] = 0;
						}
					}
				}
				return false;
			}
		}
	}

	return true;
}

